import React, { useEffect, useState } from 'react'
import './CSS/product.css';


const product= 
[
    {id:"1", name:"laptop", price:"4000000 DA", image:"data:image/jpeg;base64,"},
    {id:"2", name:"tablette", price:"5111111 DA", image:"data:image/jpeg;base64,"},
    {id:"3", name:"smartphone", price:"450000 DA", image:"data:image/jpeg;base64,"},
    {id:"4", name:"watch", price:"500000 DA ", image:"data:image/jpeg;base64,"}


  ]
export const Product = () => {
  const [searchTerms,setSearchTerms]=useState('');
  const [filteredproducts,setFilteredproducts] =useState(product);

  /*useEffect(
    ()=>{
      const filtered=product.filter(
        product=> product.name.toLowerCase().includes(searchTerms.toLowerCase())
      );
      SetFilteredproducts(filtered);
    },
    {product,searchTerms});
 */
    useEffect(() => {
      const filtered = product.filter(product =>
        product.name.toLowerCase().includes(searchTerms.toLowerCase())
      );
      setFilteredproducts(filtered);
    }, [searchTerms]);
 
  return (


    <div>
      <input type="text" 
      placeholder='Search product'
      value={searchTerms}
      onChange={(e)=>setSearchTerms(e.target.value)}

      />
      <ul className='cards'>
        {filteredproducts.map((element, index) => (
            <li key={index}>
              <img src={element.image} alt={element.name} />
              <h3>{element.name}</h3>
              <p>{element.price}</p>
            </li>
        
        
        ))}



      </ul>

    




    </div>
  )
}
export default Product;